import React from "react";
import "./App.css";
import { Account } from "./components/Account";
import SignUp from "./components/SignUp";
import Login from "./components/Login";
import Status from "./components/Status";

const App = () => {
  return (
    <Account>
      <Status />
      <SignUp />
      <Login />
    </Account>
  );
};

export default App;
